import numpy as np
from tqdm import trange, tqdm

class Solution:
    def minSwaps(self, nums: 'list[list]') -> int:
        
        zeroList = []
        oneList = []
        numsLen = len(nums)

        for i in range(numsLen):
            n = nums[i]
            assert n==0 or n==1, 'number in list should be 0 or 1'

            if n==0:
                zeroList.append(i)
            else:
                oneList.append(i)

        zeroLen = len(zeroList)
        oneLen = len(oneList)

        if zeroLen==0 or oneLen==0 or zeroLen==1 or oneLen==1:
            return 0

        if zeroLen>=oneLen:
            return findMinWrap(oneList, nums, 1)
        else:
            return findMinWrap(zeroList, nums, 0)

def findMinWrap(l, num, n):
    ll = len(l)
    num += num
    minWrapZero = ll
    minWrapOne = 0

    for startN in tqdm(l):
        stopN = startN + ll
        # try:
        nWrap = sum(num[startN:stopN])
        # except:
        #     print(num[startN:stopN])
        if n==0:
            if nWrap<minWrapZero:
                minWrapZero = nWrap
        if n==1:
            if nWrap>minWrapOne:
                minWrapOne = nWrap

    if n == 0:
        return minWrapZero
    else: 
        return int(ll-minWrapOne)
    
